import React from "react";
import LeftInfo from "./profileInfo/leftInfo";
import RightInfo from "./profileInfo/rightInfo";

const ProfileInfo = () => {
  return (
    <React.Fragment>
      <h3>Profile Info</h3>
      <div className="clearfix">
        <div className="w-6/12 float-left"></div>
        <LeftInfo />
        <RightInfo />
      </div>
    </React.Fragment>
  );
};

export default ProfileInfo;
